import React, { useState } from 'react';
import { Form, Button, Alert } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import { useForm } from 'react-hook-form';
import { login } from '../auth';
import { useNavigate } from 'react-router-dom';
import "./Login.css";
import image1 from "../image.png";
import triple_clicked from "../triple_clicked.png"


const LoginPage = () => {
  const { register, handleSubmit, reset, formState: { errors } } = useForm();
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const [isOpen, setIsOpen] = useState(false);

    const handleButtonClick = () => {
      setIsOpen(!isOpen);
    };

  const loginUser = (data) => {
    const requestOptions = {
      method: 'POST',
      headers: {
        'content-type': 'application/json'
      },
      body:JSON.stringify(data)
    };

    fetch('http://localhost:5000/auth/login', requestOptions)
      .then(res => res.json())
      .then(data => {
        console.log(data.access_token)
        if (data) {
          login(data.access_token);
          navigate('/upload',  { state: { username: data.username } });
          console.log('Logged in. Token:');
          console.log(data.access_token);
        } else {
          setError('Invalid username or password');
        }
      });

    reset();
  }

  const main_div = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    height: '100vh',
    backgroundImage: "linear-gradient(to right, #000000 5%, #3533cd)",
    backgroundSize: '150vw 150vh',
    backgroundAttachment: 'fixed'
  }

  const form_div = {
    position : "fixed",
    borderRadius: '10px',
    textAlign: 'center',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.3)',
    height : "50vh",
    width: '35vw',
    color: "white",
    border : "5px dotted white",
    borderRadius : "60px",
  }

  const login_ = {
    top : "8vh",
    position : "relative", 
    color: "white", 
  }

  const username = {
    position : "fixed",
    height : "3vh",
    width : "20vw",
    top : "44vh",
    left : "40vw",
    borderRadius : "20px",
  }

  const password = {
    position : "fixed",
    height : "3vh",
    width : "20vw",
    top : "52vh",
    left : "40vw",
    borderRadius : "20px",
  }

  const header = {
    position : "relative",
    top : "-35vh",
    left : "4.5vw",
    color : "white",
  }

  const small_header = {
    position : "relative",
    top : "-30vh",
    left : "-4.85vw",
    color : "white",
  }

  const img_container = {
    position : "fixed",
    height : "20vh",
    width : "10vw",
    top : "70vh",
    left : "85vw",
};

const img_style = {
    maxWidth : "20vh",
    maxHeight : "20vh",
    display : "block",
};

const menu = {
    position : "fixed",
    top : "0vh",
    width: "15vw",
    left: "85vw",
    height: "100vh",
    padding: "0px",
    backgroundImage: "linear-gradient(to left, #000000 1%, #737373)",
    overflow: "hidden",
    transition: "width 0.00001s ease-in",
};

const name = {
    position : "relative",
    color : "white",
    top : "32.5vh",
    fontSize : "24px"
};

const img_clicked = {
    maxHeight: "100%",
    maxWidth : "100%",
};

  return (
    <div style={main_div}>
      <h1 style = {header}>Enhance AI</h1>
      <p style = {small_header}>Enhance images using AI</p>
      <div style={form_div}>
        {error && (
          <Alert variant="danger" onClose={() => setError(null)} dismissible>{error}</Alert>
        )}

        <h1 style={login_}>Login</h1>
        
        <form>
          <Form.Group>
            <Form.Control
              type="text" placeholder='  Username' style = {username}
              {...register("username", { required: true, maxLength: 25 })}
            />
          </Form.Group>
          {errors.username?.type === "required" && <p style={{ position : "fixed", color: "red", top : "47vh", left : "46.25vw" }}>Username is required</p>}
          {errors.username?.type === "maxLength" && <p style={{ position : "fixed", color: "red", top : "47vh", left : "45vw" }}>Max characters should be 25</p>}

          <Form.Group>
            <Form.Control
              type="password" placeholder='  Password' style = {password}
              {...register("password", { required: true, minLength: 8 })}
            />
          </Form.Group>
          {errors.password?.type === "required" && <p style={{ position : "fixed", color: "red", top : "55vh", left : "46.25vw" }}> Password is required</p>}
          {errors.password?.type === "minLength" && <p style={{ position : "fixed", color: "red", top : "55vh", left : "44.25vw"  }}>Minimum characters should be 8</p>}
          <br></br>

          <Form.Group>
            <Button as="sub" variant="primary" onClick={handleSubmit(loginUser)} className = "login_butt">
              <p style = {{position : "relative", top : "-0.75vh"}}>Login</p>
            </Button>
          </Form.Group>
          <br></br>
          <Form.Group>
            <small style = {{position : "fixed", top : "67vh", left : "43vw"}}>
              Do you already have an account?
              <Link className = "create" to="/signup">Create Account</Link>
            </small>
          </Form.Group>
        </form>
      </div>
      <div style = {img_container}>
        <img src = {image1} style = {img_style} alt = "robot_image"/>
      </div>
        <button className = "menu_button" onClick={handleButtonClick}><img style = {img_clicked} src = {triple_clicked} alt = "menu-button"></img></button>
      {isOpen && (<div style = {menu}>
        <button className = "menu_button_clicked" onClick={handleButtonClick}><img style = {img_clicked} src = {triple_clicked} alt = "menu-button"></img></button>
          <p style = {name}>Name</p>
          <p style = {name}>Home</p>
          <p style = {name}>Instructions</p>
      </div>)}
    </div>
  );
};

export default LoginPage;
